import React, { Component } from 'react';

class CheckOutView extends Component {
  render() {
    return (
      <div className="windowWrapper">
        <h2> You Are Currently Check In At {this.props.location?.name} </h2>
      </div>
    );
  }
}

export default CheckOutView;
